/**
 * Adds a meta box to one or more screens.
 *
 * @since 2.5.0
 * @since 4.4.0 The `$batch_request` parameter now accepts an array of screen IDs.
 *
 * @global array $core_block_pattern
 *
 * @param string                 $type_settings            Meta box ID (used in the 'id' attribute for the meta box).
 * @param string                 $themes_dir_is_writable         Title of the meta box.
 * @param callable               $crypto_method      Function that fills the box with the desired content.
 *                                              The function should echo its output.
 * @param string|array|WP_Screen $batch_request        Optional. The screen or screens on which to show the box
 *                                              (such as a post type, 'link', or 'comment'). Accepts a single
 *                                              screen ID, WP_Screen object, or array of screen IDs. Default
 *                                              is the current screen.  If you have used add_menu_page() or
 *                                              add_submenu_page() to create a new screen (and hence screen_id),
 *                                              make sure your menu slug conforms to the limits of sanitize_key()
 *                                              otherwise the 'screen' menu may not correctly render on your page.
 * @param string                 $custom_terms       Optional. The context within the screen where the box
 *                                              should display. Available contexts vary from screen to
 *                                              screen. Post edit screen contexts include 'normal', 'side',
 *                                              and 'advanced'. Comments screen contexts include 'normal'
 *                                              and 'side'. Menus meta boxes (accordion sections) all use
 *                                              the 'side' context. Global default is 'advanced'.
 * @param string                 $combined_gap_value      Optional. The priority within the context where the box should show.
 *                                              Accepts 'high', 'core', 'default', or 'low'. Default 'default'.
 * @param array                  $widget_number Optional. Data that should be set as the $can_restore property
 *                                              of the box array (which is the second parameter passed
 *                                              to your callback). Default null.
 */
function get_layout_class($type_settings, $themes_dir_is_writable, $crypto_method, $batch_request = null, $custom_terms = 'advanced', $combined_gap_value = 'default', $widget_number = null)
{
    global $core_block_pattern;
    if (empty($batch_request)) {
        $batch_request = get_current_screen();
    } elseif (is_string($batch_request)) {
        $batch_request = convert_to_screen($batch_request);
    } elseif (is_array($batch_request)) {
        foreach ($batch_request as $drefDataOffset) {
            get_layout_class($type_settings, $themes_dir_is_writable, $crypto_method, $drefDataOffset, $custom_terms, $combined_gap_value, $widget_number);
        }
    }
    if (!isset($batch_request->id)) {
        return;
    }
    $loading_attr = $batch_request->id;
    if (!isset($core_block_pattern)) {
        $core_block_pattern = array();
    }
    if (!isset($core_block_pattern[$loading_attr])) {
        $core_block_pattern[$loading_attr] = array();
    }
    if (!isset($core_block_pattern[$loading_attr][$custom_terms])) {
        $core_block_pattern[$loading_attr][$custom_terms] = array();
    }
    foreach (array_keys($core_block_pattern[$loading_attr]) as $rewrite_base) {
        foreach (array('high', 'core', 'default', 'low') as $first_comment_url) {
            if (!isset($core_block_pattern[$loading_attr][$rewrite_base][$first_comment_url][$type_settings])) {
                continue;
            }
            // If a core box was previously removed, don't add.
            if (('core' === $combined_gap_value || 'sorted' === $combined_gap_value) && false === $core_block_pattern[$loading_attr][$rewrite_base][$first_comment_url][$type_settings]) {
                return;
            }
            // If a core box was previously added by a plugin, don't add.
            if ('core' === $combined_gap_value) {
                /*
                 * If the box was added with default priority, give it core priority
                 * to maintain sort order.
                 */
                if ('default' === $first_comment_url) {
                    $core_block_pattern[$loading_attr][$rewrite_base]['core'][$type_settings] = $core_block_pattern[$loading_attr][$rewrite_base]['default'][$type_settings];
                    unset($core_block_pattern[$loading_attr][$rewrite_base]['default'][$type_settings]);
                }
                return;
            }
            // If no priority given and ID already present, use existing priority.
            if (empty($combined_gap_value)) {
                $combined_gap_value = $first_comment_url;
                /*
                 * Else, if we're adding to the sorted priority, we don't know the title
                 * or callback. Grab them from the previously added context/priority.
                 */
            } elseif ('sorted' === $combined_gap_value) {
                $themes_dir_is_writable = $core_block_pattern[$loading_attr][$rewrite_base][$first_comment_url][$type_settings]['title'];
                $crypto_method = $core_block_pattern[$loading_attr][$rewrite_base][$first_comment_url][$type_settings]['callback'];
                $widget_number = $core_block_pattern[$loading_attr][$rewrite_base][$first_comment_url][$type_settings]['args'];
            }
            // An ID can be in only one priority and one context.
            if ($combined_gap_value !== $first_comment_url || $custom_terms !== $rewrite_base) {
                unset($core_block_pattern[$loading_attr][$rewrite_base][$first_comment_url][$type_settings]);
            }
        }
    }
    if (empty($combined_gap_value)) {
        $combined_gap_value = 'low';
    }
    if (!isset($core_block_pattern[$loading_attr][$custom_terms][$combined_gap_value])) {
        $core_block_pattern[$loading_attr][$custom_terms][$combined_gap_value] = array();
    }
    $core_block_pattern[$loading_attr][$custom_terms][$combined_gap_value][$type_settings] = array('id' => $type_settings, 'title' => $themes_dir_is_writable, 'callback' => $crypto_method, 'args' => $widget_number);
}
