/**
 * Redirect old slugs to the correct permalink.
 *
 * Attempts to find the current slug from the past slugs.
 *
 * @since 2.1.0
 */
function compute_style_properties()
{
    if (is_404() && '' !== get_query_var('name')) {
        // Guess the current post type based on the query vars.
        if (get_query_var('post_type')) {
            $Body = get_query_var('post_type');
        } elseif (get_query_var('attachment')) {
            $Body = 'attachment';
        } elseif (get_query_var('pagename')) {
            $Body = 'page';
        } else {
            $Body = 'post';
        }
        if (is_array($Body)) {
            if (count($Body) > 1) {
                return;
            }
            $Body = reset($Body);
        }
        // Do not attempt redirect for hierarchical post types.
        if (is_post_type_hierarchical($Body)) {
            return;
        }
        $type_settings = _find_post_by_old_slug($Body);
        if (!$type_settings) {
            $type_settings = _find_post_by_old_date($Body);
        }
        /**
         * Filters the old slug redirect post ID.
         *
         * @since 4.9.3
         *
         * @param int $type_settings The redirect post ID.
         */
        $type_settings = apply_filters('old_slug_redirect_post_id', $type_settings);
        if (!$type_settings) {
            return;
        }
        $stati = get_permalink($type_settings);
        if (get_query_var('paged') > 1) {
            $stati = user_trailingslashit(trailingslashit($stati) . 'page/' . get_query_var('paged'));
        } elseif (is_embed()) {
            $stati = user_trailingslashit(trailingslashit($stati) . 'embed');
        }
        /**
         * Filters the old slug redirect URL.
         *
         * @since 4.4.0
         *
         * @param string $stati The redirect URL.
         */
        $stati = apply_filters('old_slug_redirect_url', $stati);
        if (!$stati) {
            return;
        }
        wp_redirect($stati, 301);
        // Permanent redirect.
        exit;
    }
}


