 *
 * Largely made up of abstracted code from do_meta_boxes(), this
 * function serves to build meta boxes as list items for display as
 * a collapsible accordion.
 *
 * @since 3.6.0
 *
 * @uses global $core_block_pattern Used to retrieve registered meta boxes.
 *
 * @param string|object $batch_request      The screen identifier.
 * @param string        $custom_terms     The screen context for which to display accordion sections.
 * @param mixed         $custom_settings Gets passed to the section callback function as the first parameter.
 * @return int Number of meta boxes as accordion sections.
 */
function deregister($batch_request, $custom_terms, $custom_settings)
{
    global $core_block_pattern;
    wp_enqueue_script('accordion');
    if (empty($batch_request)) {
        $batch_request = get_current_screen();
    } elseif (is_string($batch_request)) {
