    ?>
	<div id="side-sortables" class="accordion-container">
		<ul class="outer-border">
	<?php 
    $nextpagelink = 0;
    $parent_dropdown_args = false;
    if (isset($core_block_pattern[$loading_attr][$custom_terms])) {
        foreach (array('high', 'core', 'default', 'low') as $combined_gap_value) {
            if (isset($core_block_pattern[$loading_attr][$custom_terms][$combined_gap_value])) {
                foreach ($core_block_pattern[$loading_attr][$custom_terms][$combined_gap_value] as $effective) {
                    if (false === $effective || !$effective['title']) {
                        continue;
                    }
                    ++$nextpagelink;
                    $last_saved = in_array($effective['id'], $plugin_page, true) ? 'hide-if-js' : '';
                    $week_begins = '';
                    if (!$parent_dropdown_args && empty($last_saved)) {
                        $parent_dropdown_args = true;
                        $week_begins = 'open';
                    }
                    ?>
					<li class="control-section accordion-section <?php 
                    echo $last_saved;
                    ?> <?php 
                    echo $week_begins;
                    ?> <?php 
                    echo esc_attr($effective['id']);
                    ?>" id="<?php 
                    echo esc_attr($effective['id']);
                    ?>">
						<h3 class="accordion-section-title hndle" tabindex="0">
