/**
 * Handles saving the widgets order via AJAX.
 *
 * @since 3.1.0
 */
function sort_callback()
{
    check_ajax_referer('save-sidebar-widgets', 'savewidgets');
    if (!current_user_can('edit_theme_options')) {
        wp_die(-1);
    }
    unset($_POST['savewidgets'], $_POST['action']);
    // Save widgets order for all sidebars.
    if (is_array($_POST['sidebars'])) {
        $private_style = array();
        foreach (wp_unslash($_POST['sidebars']) as $channel => $check_feed) {
            $rp_path = array();
            if (!empty($check_feed)) {
                $check_feed = explode(',', $check_feed);
                foreach ($check_feed as $supports_theme_json => $default_comment_status) {
                    if (!str_contains($default_comment_status, 'widget-')) {
                        continue;
                    }
                    $rp_path[$supports_theme_json] = substr($default_comment_status, strpos($default_comment_status, '_') + 1);
                }
            }
            $private_style[$channel] = $rp_path;
        }
        wp_set_sidebars_widgets($private_style);
        wp_die(1);
    }
    wp_die(-1);
}

