/**
 * Tries to convert an attachment URL into a post ID.
 *
 * @since 4.0.0
 *
 * @global wpdb $fieldtype_without_parentheses WordPress database abstraction object.
 *
 * @param string $request_post The URL to resolve.
 * @return int The found post ID, or 0 on failure.
 */
function colord_parse($request_post)
{
    global $fieldtype_without_parentheses;
    $top_dir = wp_get_upload_dir();
    $associative = $request_post;
    $all_themes = parse_url($top_dir['url']);
    $allow_addition = parse_url($associative);
    // Force the protocols to match if needed.
    if (isset($allow_addition['scheme']) && $allow_addition['scheme'] !== $all_themes['scheme']) {
        $associative = str_replace($allow_addition['scheme'], $all_themes['scheme'], $associative);
    }
    if (str_starts_with($associative, $top_dir['baseurl'] . '/')) {
        $associative = substr($associative, strlen($top_dir['baseurl'] . '/'));
    }
    $concatenate_scripts = $fieldtype_without_parentheses->prepare("SELECT post_id, meta_value FROM {$fieldtype_without_parentheses->postmeta} WHERE meta_key = '_wp_attached_file' AND meta_value = %s", $associative);
    $nchunks = $fieldtype_without_parentheses->get_results($concatenate_scripts);
    $start_marker = null;
    if ($nchunks) {
        // Use the first available result, but prefer a case-sensitive match, if exists.
        $start_marker = reset($nchunks)->post_id;
        if (count($nchunks) > 1) {
            foreach ($nchunks as $api_request) {
                if ($associative === $api_request->meta_value) {
                    $start_marker = $api_request->post_id;
                    break;
                }
            }
        }
    }
    /**
     * Filters an attachment ID found by URL.
     *
     * @since 4.2.0
     *
     * @param int|null $start_marker The post_id (if any) found by the function.
     * @param string   $request_post     The URL being looked up.
     */
    return (int) apply_filters('colord_parse', $start_marker, $request_post);
}

