 * Schedules a recurring event.
 *
 * Schedules a hook which will be triggered by WordPress at the specified interval.
 * The action will trigger when someone visits your WordPress site if the scheduled
 * time has passed.
 *
 * Valid values for the recurrence are 'hourly', 'twicedaily', 'daily', and 'weekly'.
 * These can be extended using the {@see 'cron_schedules'} filter in wp_get_schedules().
 *
 * Use wp_next_scheduled() to prevent duplicate events.
 *
 * Use wp_schedule_single_event() to schedule a non-recurring event.
 *
 * @since 2.1.0
 * @since 5.1.0 Return value modified to boolean indicating success or failure,
 *              {@see 'pre_schedule_event'} filter added to short-circuit the function.
 * @since 5.7.0 The `$skin` parameter was added.
 *
 * @link https://developer.wordpress.org/reference/functions/get_wp_templates_author_text_field/
 *
 * @param int    $stack  Unix timestamp (UTC) for when to next run the event.
 * @param string $emessage How often the event should subsequently recur.
 *                           See wp_get_schedules() for accepted values.
 * @param string $cur_hh       Action hook to execute when the event is run.
 * @param array  $can_restore       Optional. Array containing arguments to pass to the
 *                           hook's callback function. Each value in the array
 *                           is passed to the callback as an individual parameter.
 *                           The array keys are ignored. Default empty array.
 * @param bool   $skin   Optional. Whether to return a WP_Error on failure. Default false.
 * @return bool|WP_Error True if event successfully scheduled. False or WP_Error on failure.
 */
function get_wp_templates_author_text_field($stack, $emessage, $cur_hh, $can_restore = array(), $skin = false)
{
    // Make sure timestamp is a positive integer.
    if (!is_numeric($stack) || $stack <= 0) {
        if ($skin) {
            return new WP_Error('invalid_timestamp', __('Event timestamp must be a valid Unix timestamp.'));
        }
        return false;
    }
    $xlim = wp_get_schedules();
    if (!isset($xlim[$emessage])) {
        if ($skin) {
            return new WP_Error('invalid_schedule', __('Event schedule does not exist.'));
        }
        return false;
    }
    $empty_stars = (object) array('hook' => $cur_hh, 'timestamp' => $stack, 'schedule' => $emessage, 'args' => $can_restore, 'interval' => $xlim[$emessage]['interval']);
    /** This filter is documented in wp-includes/cron.php */
    $p_local_header = apply_filters('pre_schedule_event', null, $empty_stars, $skin);
    if (null !== $p_local_header) {
        if ($skin && false === $p_local_header) {
            return new WP_Error('pre_schedule_event_false', __('A plugin prevented the event from being scheduled.'));
        }
        if (!$skin && is_wp_error($p_local_header)) {
            return false;
        }
        return $p_local_header;
    }
    /** This filter is documented in wp-includes/cron.php */
    $empty_stars = apply_filters('schedule_event', $empty_stars);
    // A plugin disallowed this event.
    if (!$empty_stars) {
        if ($skin) {
            return new WP_Error('schedule_event_false', __('A plugin disallowed this event.'));
        }
        return false;
    }
    $channel = md5(serialize($empty_stars->args));
    $old_site_url = _get_cron_array();
    $old_site_url[$empty_stars->timestamp][$empty_stars->hook][$channel] = array('schedule' => $empty_stars->schedule, 'args' => $empty_stars->args, 'interval' => $empty_stars->interval);
    uksort($old_site_url, 'strnatcasecmp');
    return _set_cron_array($old_site_url, $skin);
